import styled from "styled-components";
import MainSecCarouselImg from "./MainSecCarouselImg";
import MainSecCarouselTitle from "./MainSecCarouselTitle";


const SectionCTA = styled.section`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    position: relative;
`



function Section05() {
    return (
        <SectionCTA>
            <MainSecCarouselTitle />
            <MainSecCarouselImg />
        </SectionCTA>
    )
}

export default Section05
